import React from "react";
import Tetris from "./react-tetris/src/components/tetris/tetris";

const Games = () => {
  return (
    <div>
      <Tetris
        settings={{
          blockSize: 4,
          offset: 2,
          rows: 20,
          columns: 10,
          blockBorderWidth: 5,
          boardColor: "black",
          blockBorderRadius: "30%",
          intervalTimeInMiliSeconds: 1000,
          blockOutline: 0,
          animation: false,
          boardBorderColor: "transparent",
        }}
      />
    </div>
  );
};

export default Games;
